import {
  FormControl,
  FormLabel,
  FormErrorMessage,
  FormHelperText,
  VStack,
} from "@chakra-ui/react";

function Login(){
    return (
      <VStack>
        <FormControl id="email" isRequired>
          <FormLabel>Email</FormLabel>
          <input
            type="email"
            //value={email}
            placeholder="Enter your email address"
          />
        </FormControl>
        <FormControl id="password" is>
            <FormLabel>Password</FormLabel>
        </FormControl>
      </VStack>
    );
}

export default Login;
